import React from 'react';
import { Box, Typography, useTheme } from '@mui/material';

const Navbar = () => {
  const theme = useTheme();
  return (
    <Box
      width="100%"
      backgroundColor={theme.palette.background.alt}
      p="1rem 6%"
      display="flex"
      alignItems="center"
      justifyContent="space-between"
      textAlign="center"
      sx={{ boxShadow: 3, mb: 2 }}
      minHeight="64px"
    >
      <Box sx={{ margin: '0 auto' }}>
        {/*<img src="/client/logo.png" alt="Logo" height={40} />*/}
        <Typography variant="h1" color="primary" fontWeight="bold" style={{ fontFamily: 'Space Grotesk' }}>
          MyGPT
        </Typography>
      </Box>

      <Box>
        <Typography
          component="span"
          variant="body1"
          color="primary"
          fontWeight="bold"
          sx={{
            border: '2px solid',
            borderRadius: '30px',
            padding: '8px 16px',
            marginRight: '10px',
            cursor: 'pointer',
          }}
        >
          Login
        </Typography>
        <Typography
          component="span"
          variant="body1"
          color="primary"
          fontWeight="bold"
          sx={{
            border: '2px solid',
            borderRadius: '30px',
            padding: '8px 16px',
            cursor: 'pointer',
          }}
        >
          Sign Up
        </Typography>
      </Box>
    </Box>
  );
};

export default Navbar;
